B.Ur=new A.aD("Apakah saya harus registrasi akun di Biller?",null,B.u,null,null,null,null,null,null)
B.Ua=new A.aD("Ya. Proses registrasi akun di Biller sangat mudah dan gratis. Detail akun Anda akan disimpan untuk memudahkan transaksi Anda selanjutnya di Biller. Apabila Anda sedang bertransaksi namun belum sempat daftar akun, Anda bisa langsung memasukkan alamat email di kolom yang tersedia. Secara otomatis alamat email Anda akan terdaftar menjadi akun di Biller dan Anda akan dikirimi email notifikasi. Kemudian, selesaikan transaksi yang sedang dilakukan.",null,B.u,null,null,null,null,null,null)
B.UC=new A.aD("Bagaimana cara untuk melakukan registrasi di situs Biller?",null,B.u,null,null,null,null,null,null)
