B.U5=new A.aD("Apabila melalui aplikasi, download aplikasi Biller terlebih dulu, kemudian buka aplikasi dan pilih menu 'Register'. Masukkan nama, nomor ponsel, alamat email, dan password, lalu klik 'Register'.",null,B.u,null,null,null,null,null,null)
B.TJ=new A.aD("Anda telah selesai melakukan registrasi dan email konfirmasi akan langsung dikirimkan ke alamat email yang didaftarkan.",null,B.u,null,null,null,null,null,null)
B.Uu=new A.aD("Saya lupa dengan password akun Biller saya. Bagaimana cara agar saya bisa mendapat password saya kembali?",null,B.u,null,null,null,null,null,null)
B.U4=new A.aD("Pada situs atau aplikasi Biller, pilih menu 'Sign In', kemudian pilih opsi 'Lupa Password Masuk ke Biller?' yang ada di bagian bawah kotak Sign In. Kemudian, Anda perlu memasukkan alamat email yang Anda gunakan saat registrasi. Anda akan dikirimi email konfirmasi untuk mereset atau mengatur ulang password akun Biller Anda. Masukkan password atau kata sandi baru yang Anda inginkan, kemudian klik 'Ubah Kata Sandi'.",null,B.u,null,null,null,null,null,null)
B.U9=new A.aD("Bagaimana cara mengganti password akun Biller saya?",null,B.u,null,null,null,null,null,null)
